%% Wind Turbineâ€“Like Data
t = 0:1:60;                 % coarse time (s)
N = numel(t);

baseWind = 8;               % mean wind speed (m/s)
gust      = 1.5*sin(0.1*t); % slow variation
turb      = 0.5*randn(1,N); % turbulence

windSpeed = baseWind + gust + turb;
windSpeed(windSpeed < 0) = 0;   % physical limit

%% Interpolation (estimate BETWEEN points)
tq = 0:0.1:60;                    % fine time vector
windInterp = interp1(t, windSpeed, tq, 'pchip');

%% Curve Fitting (overall TREND)
p = polyfit(t, windSpeed, 1);     % linear trend
windFit = polyval(p, tq);

%% Plot Results
figure %[output:15851b05]

% --- Plot 1: Interpolation ---
subplot(2,1,1) %[output:15851b05]
plot(t, windSpeed, 'o', 'LineWidth', 1.5) %[output:15851b05]
hold on %[output:15851b05]
plot(tq, windInterp, '-', 'LineWidth', 2) %[output:15851b05]
grid on %[output:15851b05]
xlabel('Time (s)') %[output:15851b05]
ylabel('Wind Speed (m/s)') %[output:15851b05]
title('Interpolation of Wind Speed') %[output:15851b05]
legend('Measured Data', 'Interpolated (PCHIP)', 'Location', 'best') %[output:15851b05]

% --- Plot 2: Curve Fitting ---
subplot(2,1,2) %[output:15851b05]
plot(t, windSpeed, 'o', 'LineWidth', 1.5) %[output:15851b05]
hold on %[output:15851b05]
plot(tq, windFit, '-', 'LineWidth', 2) %[output:15851b05]
grid on %[output:15851b05]
xlabel('Time (s)') %[output:15851b05]
ylabel('Wind Speed (m/s)') %[output:15851b05]
title('Curve Fitting (Trend)') %[output:15851b05]
legend('Measured Data', 'Linear Fit', 'Location', 'best') %[output:15851b05]

